import { Form } from "react-bootstrap";

const FormSelect = (props) => {
  console.log(props.roles);
  return (
    <>
      <Form.Label>User Roles</Form.Label>
      <Form.Select>
          <option v></option>
      </Form.Select>
    </>
  );
};
export default FormSelect;
